const Home = () => {
  return (
    <>
      <header>
        <span>Icon</span>
        <div className="contact">
          <p>Contact me</p>
          <p>cateasabina5@gmail.com</p>
        </div>
      </header>
      <aside className="leftSide">
        <h1>I'am</h1>
        <h1>SABINA</h1>
        <button>My Work</button>
      </aside>
    </>
  );
};

export default Home;
